import React from "react";
import styled from "styled-components";

export const Gender = () => {
  return (
    <StyledWrapper>
      <div className="container-fluid">
        <div className="row gender">
          <h2>Choose your sex</h2>
        </div>
        <div className="row">
          <button type="button" onClick={() => history.push("./FatLoss")}>
            Women
          </button>
          <button type="button" onClick={() => history.push("./FatLoss")}>
            Men
          </button>
        </div>
      </div>
    </StyledWrapper>
  );
};

const StyledWrapper = styled.div`
  .container-fluid {
    background-color: #1a273e;
    height: 50vh;
  }
  .gender {
    color: white;
  }
`;
